import React from "react";

export default function CategoriesPage() {
  return (
    <div className="bg-white dark:bg-gray-800 p-6 rounded-lg shadow text-gray-900 dark:text-gray-100">
      <h2 className="text-xl font-semibold mb-4">Categories</h2>
      
      <p className="text-gray-600 dark:text-gray-300">Category management will go here.</p>
    </div>
  );
}
